import React from 'react';
import { Button, Container, Row, Col } from 'react-bootstrap';

const ButtonComponent = () => {
  const handleClick = () => {
    // Handle button click event
    console.log('Button Clicked!');
  };

  return (
    <div>
      <h1>Welcome to My App</h1>
      <Button variant="primary" onClick={handleClick}>Primary Button</Button>
      <Button variant="secondary" onClick={handleClick}>Secondary Button</Button>
      <Button variant="success" onClick={handleClick}>Success Button</Button>
      <Button variant="danger" onClick={handleClick}>Danger Button</Button>
      <Button variant="warning" onClick={handleClick}>Warning Button</Button>
      <Button variant="info" onClick={handleClick}>Info Button</Button>
      <Button variant="light" onClick={handleClick}>Light Button</Button>
      <Button variant="dark" onClick={handleClick}>Dark Button</Button>
      <Button variant="purple" onClick={handleClick}>Purple Button</Button>
      <Button variant="link" onClick={handleClick}>Link Button</Button>
    </div>
  );
};


const MultipleElementsComponent = () => {
  // Define data for multiple divs and buttons
  const elements = [
    {
      id: 1,
      buttons: [
        { id: 11, label: 'Button 1' },
        { id: 12, label: 'Button 2' },
        { id: 13, label: 'Button 3' }
      ]
    },
    {
      id: 2,
      buttons: [
        { id: 21, label: 'Button 4' },
        { id: 22, label: 'Button 5' }
      ]
    }
  ];

  return (
    <Container>
      {elements.map(element => (
        <div key={element.id} className="mb-4">
          <h2>Element {element.id}</h2>
          <Row>
            {element.buttons.map(button => (
              <Col key={button.id} md={3} className="mb-2">
                <Button variant="primary">{button.label}</Button>
              </Col>
            ))}
          </Row>
        </div>
      ))}
    </Container>
  );
};



export default ButtonComponent;
